var portal = Portal("{{portalBaseUrl}}/");
//Event table, OperationsManagement fs
var eventsfs = FeatureSetByPortalItem(portal,"{{6f072b0ebad74ae9a06ab4569c065956.itemId}}",1,["eventstart","eventend","eventname","status"],false);
var eventLatest = Top(OrderBy(Filter(eventsfs, "status = 'Active'"),'eventstart DESC'),1);

var fsSchema = Schema(eventLatest)
var fields = fsSchema['fields']

//add duration field to schema
Push(fields, {'name':'calcduration', 'alias': 'Duration','type':'esriFieldTypeString'})
Push(fields, {'name':'calcday', 'alias': 'Day', 'type':'esriFieldTypeString'})

//Get all date fields, need to convert attributes to epoch milliseconds
var dateFields = [];
for (var i in fields) {
    var field = fields[i];
    if (field['type'] == 'esriFieldTypeDate') {
        Push(dateFields, field['name']);
    }
}

var active = {'fields': fields, 'geometryType': "" }
var newFeatures = [];
for (var f in eventLatest) {
    var newFeature = Dictionary(Text(f));
    var attributes = Dictionary(Text(newFeature['attributes']));
    
    //Add the calculated attribute
    attributes['calcduration'] =  Round(DateDiff(Now(), attributes['eventstart'], 'hours'),1) + " hours"
    attributes['calcday'] = Text(Date(attributes['eventstart']),'MM/DD/YY h:mm A')   
    
    //Convert all date field attributes to epoch milliseconds
    for (i in dateFields) {
        var dateField = dateFields[i];
        attributes[dateField] = DateDiff(attributes[dateField], Date(0), 'milliseconds');
    }
    
    //Add the new feature to array
    newFeature['attributes'] = attributes;
    Push(newFeatures, newFeature);
}

active['features'] = newFeatures;
return FeatureSet(Text(active));

